package edu.rice.cs.bioinfo.programs.phylonet.algos.fasttrees;

import edu.rice.cs.bioinfo.programs.phylonet.algos.substitution.observations.NucleotideObservation;
import edu.rice.cs.bioinfo.programs.phylonet.structs.tree.model.Tree;
import edu.rice.cs.bioinfo.programs.phylonet.structs.tree.util.HmmTreeUtils;
import org.apache.commons.io.IOUtils;

import java.io.IOException;
import java.util.*;

/**
 * This class handles the utilization of FastTrees by running FastTrees on segments of dna and collecting the unique gene topologies.
 * Make sure FastTrees.exe is in the current working directory for this to work.
 */
public class FastTrees
{


    /**
     * The size of the window for FastTrees processing.
     */
    public static final int WINDOW_SIZE = 100;

    /**
     * The offset of each window from the previous window.
     */
    public static final int WINDOW_OFFSET = 100;



    private final List<NucleotideObservation> nucleotideObservations;

    private final ProcessBuilder pb = new ProcessBuilder("FastTree.exe", "-nt", "-nosupport", "-nocat", "-slow");

    /**
     * Constructs a FastTrees handler with the given dna.
     * Note: One of the alleles must be an outgroup and thus be labeled 'outgroup' for this method to work.
     * @param nucleotideObservations Nucleotide observations for the dna.
     */
    public FastTrees(List<NucleotideObservation> nucleotideObservations)
    {
        if (!nucleotideObservations.get(0).getAlleles().contains("outgroup"))
            throw new RuntimeException("There must be an outgroup for FastTrees to work properly");

        this.nucleotideObservations = nucleotideObservations;
    }


    /**
     * Calculates a list of all unique gene topologies from the given dna.
     * @return A list of all unique gene tree topologies from the data.
     */
    public List<Tree> calculateTrees()
    {
        List<Tree> result = new ArrayList<Tree>();
        int lengthOfDNA = nucleotideObservations.size();

        for (int i = 0; i + WINDOW_SIZE <= lengthOfDNA; i += WINDOW_OFFSET)
        {
            int endOfWindow = Math.min(lengthOfDNA, i + WINDOW_SIZE);

            String fasta = toFasta(nucleotideObservations.subList(i,endOfWindow));
            Tree tree = getTree(fasta);
            tree.rerootTreeAtEdge("outgroup");




            if (!alreadyInResult(tree, result))
                result.add(tree);
        }

        return result;
    }

    private boolean alreadyInResult(Tree tree, List<Tree> oldTrees)
    {
        for (Tree oldTree : oldTrees)
            if (HmmTreeUtils.sameTopology(tree, oldTree))
                return true;
        return false;
    }

    /**
     * Runs the FastTrees.exe on a certain input and gets the output tree.
     * @param input The FastTrees input in Fasta format.
     * @return The generated tree in Newick format.
     */
    private Tree getTree(String input)
    {
        try
        {
            Process p = pb.start();

            IOUtils.write(input, p.getOutputStream());

            p.getOutputStream().close();
            p.waitFor();

            String treeString = IOUtils.toString(p.getInputStream());
            return HmmTreeUtils.toTree(treeString);
        } catch (Exception e)
        {
            throw new RuntimeException(e);
        }


    }

    /**
     * Creates a Fasta string representing a sequences of observations.
     * @return A Fasta string for the dna with allele[i] for i in start <= i < stop
     */
    private String toFasta(List<NucleotideObservation> nucleotideObservations)
    {
        Collection<String> alleles = nucleotideObservations.get(0).getAlleles();

        String result = "";

        for (String allele : alleles)
        {
            result += ">" + allele + "\n";
            for (NucleotideObservation obs : nucleotideObservations)
                result += obs.getObservationForAllele(allele);
            result += "\n";
        }
        return result;
    }


    public static void main(String[] args) throws IOException, InterruptedException
    {


        Map<String, String> foo = new HashMap<String, String>()
        {{
                put("BACKGROUND", "");
                put("SPRETUS2 ", "");
                put("VARIABLE ", "");
                put("SPRETUS1 ", "");
                put("outgroup", "");
            }};


        FastTrees f = new FastTrees(NucleotideObservation.getObservations(foo));

        System.out.println(f.calculateTrees());
    }


}
